// Booking.js
import React from 'react';
import Banner from "src/components/banner.js";
import Footer from "src/components/footer.js";
import "src/styles/booking.css";
import { MapContainer } from 'https://cdn.esm.sh/react-leaflet/MapContainer'
import { TileLayer } from 'https://cdn.esm.sh/react-leaflet/TileLayer'
import { useMap } from 'https://cdn.esm.sh/react-leaflet/hooks'

function Map(){
return <MapContainer center={[55.705053, 12.585333]} zoom={15} scrollWheelZoom={false}>
<TileLayer
    attribution='&copy; <a href="https://www.openstreetmap.org/copyright">OpenStreetMap</a> contributors'
    url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
/>
{/* <Marker position={[55.705053, 12.585333]}>
</Marker> */}
</MapContainer>
}

function Article(){
    return <div class="articleBooking" style={{height: "500px"}}>
        
    </div>

}

function Aside(){
    return <div class="asideBooking">  
    </div>
}

function Booking(){
    return <div class="grid" style={{width: "70vw", margin: "auto"}}>
        <Banner/>
        <Article/>
        <Aside/>
        <Map/>
        <Footer/>
    </div>;
}

export default Booking;
